    "full_text" : "B:\n閉路があったとして1つ構成できたとしたらその閉路上の辺を全て逆にしても条件を満たす(*)\n閉路がない場合を考えるとこれは木なので葉から確定していく\n閉路がある場合木+後退辺に分けると全ての後退辺について後退辺を1つだけ含む閉路が存在する。(*)からその後退辺の向きは自由に決めて良い",
